import axios from 'axios'

export default function Home() {

  async function getTrengingItems(){

    let {data}= await axios.get("https://api.themoviedb.org/3/trending/all/day?api_key=aa717cf4da52c78e8040b5bc788cafe0");
    console.log(data);
  }

  use
  return (
    <div>Home</div>
  )
}
